-- Table: warehousenote
CREATE TABLE warehousenote (
	id INTEGER NOT NULL, 
	warehouse_id VARCHAR(16), 
	project_id INTEGER, 
	note_no VARCHAR(16), 
	note_type VARCHAR(16), 
	note_date DATE, 
	remark VARCHAR(128), 
	updated_date DATETIME, 
	updated_by VARCHAR(64), 
	PRIMARY KEY (id), 
	FOREIGN KEY(project_id) REFERENCES project (id)
);

-- Table: warehousenoteitem
CREATE TABLE warehousenoteitem (
	id INTEGER NOT NULL, 
	note_id INTEGER, 
	material_id INTEGER, 
	quantity FLOAT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(material_id) REFERENCES material (id), 
	FOREIGN KEY(note_id) REFERENCES warehousenote (id)
);

